import React from 'react';
import imgP from "../assets/img/pexels-w-rugby-6373836.jpg"

export const ArticleFoot = () => {
  return (
    <article>
        <div>
            <img src={imgP} alt=''/>
        </div>
        <div>
            <h2></h2>
            <p></p>

        </div>
    </article>
  )
}
